import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

const zeitraumRanges = [
  { label: "0-6 Monate", start: 0, end: 6, color: "#28a745" },
  { label: "7-12 Monate", start: 7, end: 12, color: "#ffc107" },
  { label: "13-24 Monate", start: 13, end: 24, color: "#dc3545" },
  { label: "über 24 Monate", start: 25, end: 36, color: "#b0b0b0" }
];

const zeitraumLabels = zeitraumRanges.map(z => z.label);

const PredictionResultTime = ({ prediction }) => {
  if (!prediction) return null;

  const { recommendations, confidence, llm_explanation, status, error } = prediction;
  const mainIdx = zeitraumLabels.indexOf(recommendations);
  const mainRange = zeitraumRanges[mainIdx] || zeitraumRanges[3];

  return (
    <Box sx={{ mt: 4 }}>
      <Paper elevation={3} sx={{ p: 3, borderRadius: 2 }}>
        <Typography variant="h6" color="primary" gutterBottom>
          Wechselzeitraum (Vorhersage)
        </Typography>
        {/* Zeitstrahl */}
        <Box sx={{ width: '100%', mt: 2, mb: 2 }}>
          <Box sx={{ position: 'relative', height: 36, bgcolor: '#f0f0f0', borderRadius: 2 }}>
            {/* Marker für alle Wahrscheinlichkeiten */}
            {Array.isArray(confidence) && confidence.map((prob, idx) => (
              <Box
                key={zeitraumRanges[idx].label}
                sx={{
                  position: 'absolute',
                  left: `${(zeitraumRanges[idx].start / 36) * 100}%`,
                  width: `${((zeitraumRanges[idx].end - zeitraumRanges[idx].start + 1) / 36) * 100}%`,
                  height: '100%',
                  bgcolor: zeitraumRanges[idx].color,
                  borderRadius: 2,
                  opacity: idx === mainIdx ? 0.85 : 0.25,
                  zIndex: idx === mainIdx ? 2 : 1,
                  border: idx === mainIdx ? '2px solid #001B41' : 'none',
                  transition: 'opacity 0.3s',
                }}
              />
            ))}
            {/* Achsenbeschriftung */}
            <Box sx={{ position: 'absolute', top: 38, left: 0, width: '100%', display: 'flex', justifyContent: 'space-between', fontSize: 14, color: '#666' }}>
              <span>0</span>
              <span>6</span>
              <span>12</span>
              <span>24</span>
              <span>36+ Monate</span>
            </Box>
          </Box>
        </Box>
        {/* Hauptwahrscheinlichkeit als Text */}
        <Typography variant="h5" sx={{ color: mainRange.color, fontWeight: 700, mt: 2 }}>
          {recommendations}
        </Typography>
        {/* Wahrscheinlichkeiten für alle Zeiträume */}
        {Array.isArray(confidence) && (
          <Box sx={{ mt: 2, mb: 2 }}>
            <Typography variant="subtitle1" sx={{ fontWeight: 600, mb: 1 }}>
              Wahrscheinlichkeiten:
            </Typography>
            <Box sx={{ display: 'flex', gap: 2, flexWrap: 'wrap' }}>
              {confidence.map((prob, idx) => (
                <Box key={zeitraumRanges[idx].label} sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  <Box sx={{ width: 16, height: 16, bgcolor: zeitraumRanges[idx].color, borderRadius: 1, mr: 0.5 }} />
                  <Typography variant="body2">
                    {zeitraumRanges[idx].label}: {(prob * 100).toFixed(1)}%
                  </Typography>
                </Box>
              ))}
            </Box>
          </Box>
        )}
        {/* Empfehlungstext */}
        <Typography sx={{ mt: 2, color: '#444', fontSize: '1.08rem' }}>
          {recommendations === "0-6 Monate" && "Jetzt ist der ideale Zeitpunkt für eine Ansprache!"}
          {recommendations === "7-12 Monate" && "In den nächsten Monaten könnte ein Wechsel interessant werden."}
          {recommendations === "13-24 Monate" && "Mittelfristig beobachten, noch kein akuter Wechselbedarf."}
          {recommendations === "über 24 Monate" && "Aktuell wenig Wechselbereitschaft, langfristig in Kontakt bleiben."}
        </Typography>
        {/* LLM-Erklärung anzeigen, falls vorhanden */}
        {llm_explanation && (
          <Box sx={{ mt: 3, p: 2, bgcolor: '#f5f5f5', borderRadius: 2 }}>
            <Typography sx={{ color: '#444', fontSize: '1.1rem', lineHeight: 1.9 }}>
              {llm_explanation}
            </Typography>
          </Box>
        )}
        {/* Fehleranzeige */}
        {status === "error" && (
          <Typography sx={{ color: '#dc3545', mt: 2 }}>{error}</Typography>
        )}
      </Paper>
    </Box>
  );
};

export default PredictionResultTime;
